import React, { Component } from 'react';
import {NavLink} from 'react-router-dom';
import styled from 'styled-components';

const MyNav= styled.nav`
  display: flex;
  flex-direction: row;
  margin: 10px;
  background-color: gray;
  `;
const MyUl= styled.ul`
list-style-type: none;
display: flex;

`;/* For styling <li> */
